(833, 10, 2, 'Nhất Vĩ Li Mao Bảo Bảo Sơ Cấp', 'HỘ THỂ: Gây mù mắt đối thủ trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100:180/250/300. Thời gian hồi: 40s/35s/30s. Khi bị mù mắt tất cả các chiêu đều hụt.', 1, 3248, 247, 0),
(834, 10, 2, 'Nhị Vĩ Ác Miêu Bảo Bảo Sơ Cấp', 'PHÁ TRIỀN: Gây hoảng sợ cho đối phương trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Hoảng sợ 50% hụt chiêu, khi chủ nhân đánh vào mục tiêu bị hoảng sợ thì mục tiêu sẽ nhận thêm 25% dame trong mỗi đòn đánh.', 1, 3249, 248, 0),
(835, 10, 2, 'Tam Vĩ Khổng Quy Bảo Bảo Sơ Cấp', 'THỦY HỒN: Làm cho đối phương bị đuối nước trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Đuối nước giảm 50% sức mạnh và 50% hồi phục hp mp.', 1, 3250, 249, 0),
(836, 10, 2, 'Tứ Vĩ Hầu Tôn Bảo Bảo Sơ Cấp', 'ĐOẠT MỆNH: Thiêu đốt mục tiêu trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Thiêu đốt mất 5% máu mỗi giây và giảm 30% khả năng hồi phục.', 1, 3251, 250, 0),
(837, 10, 2, 'Ngũ Vĩ Mã Ngư Bảo Bảo Sơ Cấp', 'CÀN KHÔN: Phá giáp đối thủ trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Khi bị lôi phá mất 80% giáp.', 1, 3252, 251, 0),
(838, 10, 2, 'Lục Vĩ Bạch Sên Bảo Bảo Sơ Cấp', 'ĐỘC KÍCH: Làm cho mục tiêu bị trúng độc trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Khi bị trúng độc mất 7% máu mỗi 1.5s và bị giảm 30% sức mạnh.', 1, 3253, 252, 0),
(839, 10, 2, 'Thất Vĩ Cương Trùng Bảo Bảo Sơ Cấp', 'KIM CANG: Làm choáng đối thủ trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Bị choáng 5s trong thời gian bị choáng không thể hồi phục.', 1, 3254, 253, 0),
(840, 10, 2, 'Bát Vĩ Khổng Ngưu Bảo Bảo Sơ Cấp', 'PHÍ HUYẾT: Gây vết thương sâu cho đối thủ trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Khi bị vết thương sâu trừ 5% máu mỗi giây, không thể hồi phục và nhận thêm 20% dame.', 1, 3255, 254, 0),
(841, 10, 2, 'Cửu Vĩ Hồ Ly Bảo Bảo Sơ Cấp', 'TIÊN KHÍ: Buff hấp thụ cho chủ nhân trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Chủ nhân khi bị tấn công trong trạng thái hấp thụ sẽ nhận thêm máu =5% sát thương đánh vào, khi bị đánh 5 đòn liên tiếp trong 15s hấp thụ sẽ bộc phá gây sát thương bằng 15% máu đối thủ. Có thể hấp thụ sát thương từ kẻ thù , hấp thụ 1 lượng nhất định sẽ phun hỏa độn với một sức công phá rất lớn, dùng lửa để cường hóa sát thương lên 15% và giáp lên 10%, Cửu vĩ hồ không sợ bất cứ vĩ thú nào cả, kháng tất cả hiệu ứng của vĩ thú khác.', 1, 3256, 255, 0),
(842, 10, 2, 'Nhất Vĩ Li Mao Sơ Cấp', 'HỘ THỂ: Gây mù mắt đối thủ trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100:180/250/300. Thời gian hồi: 40s/35s/30s. Khi bị mù mắt tất cả các chiêu đều hụt.', 1, 3239, 240, 0),
(843, 10, 2, 'Nhị Vĩ Ác Miêu Sơ Cấp', 'PHÁ TRIỀN: Gây hoảng sợ cho đối phương trong 5s khi trưởng thành. Tỷ lệ xh tại các mốc 50/70/100: 180/250/300. Thời gian hồi: 40s/35s/30s. Hoảng sợ 50% hụt chiêu, khi chủ nhân đánh vào mục tiêu bị hoảng sợ thì mục tiêu sẽ nhận thêm 25% dame trong mỗi đòn đánh.', 1, 3240, 239, 0),
