INSERT INTO `tasktemplate` (`taskId`, `name`, `detail`, `subNames`, `counts`) VALUES
(0, 'Nhiệm vụ chào làng', '', '[\"Nói chuyện với Kiriko\",\"Nói chuyện với Tabemono\",\"Nói chuyện với Kenshinto\",\"Nói chuyện với Okanechan\",\"Nói chuyện với \",\"Nói chuyện với Umayaki\",\"Gặp Tajima báo cáo\"]', '[]'),
(1, 'NV Kiến thức', '', '[\"Trả lời Tabemono\",\"\",\"\",\"\",\"\",\"Gặp Tajima báo cáo\"]', '[]'),
(2, 'NV Lần đầu dùng kiếm', '', '[\"Sử dụng vũ khí\",\"Đánh ngã bù nhìn\",\"Gặp Tajima báo cáo\"]', '[-1,10,-1]'),
(3, 'NV Diệt sên trừ cóc', 'Ghi chú: Thức ăn (ông Tabemono), ốc sên (Vách Ichidai), cóc xanh (Vách Ichidai)', '[\"Mua thức ăn cơm nấm\",\"Sử dụng thức ăn\",\"Đánh ốc sên\",\"Đánh cóc xanh\",\"Gặp Tajima báo cáo\"]', '[2,-1,20,10,-1]'),
(4, 'NV Vật liệu tạo giáp', 'Ghi chú: Sau khi đạt cấp 5, đánh nhím đá sẽ rớt ra lông nhím (Đồi Fumimen), thỏ xám sẽ rớt ra da thỏ (Vách Ichidai)', '[\"Trình độ đạt cấp 5\",\"Nhặt lông nhím\",\"Nhặt da thỏ\",\"Báo cáo với trưởng làng\"]', '[-1,2,2,-1]'),
(5, 'NV Hái thuốc cứu người', 'Ghi chú: Sau khi đạt cấp 6, đánh cây thảo dược sẽ rớt ra bông thảo dược (Thác Kitajima, Chân thác Kitajima)', '[\"Trình độ đạt cấp 6\",\"Nhặt bông thảo dược\",\"Tìm Kiriko báo cáo\"]', '[-1,15,-1]'),
(6, 'NV Khám phá xa làng', 'Ghi chú: Mở và tìm trên bản đồ để biết vị trí.', '[\"Trình độ đạt cấp 7\",\"Đến khu luyện tập\",\"Đến khu rừng già\",\"Đến cánh đồng Fuki\",\"Gặp Umayaki báo cáo.\"]', '[]'),
(7, 'NV Bài học vào trường', '', '[\"Trình độ đạt cấp 8\",\"Tìm Tabemono Trả lời câu hỏi\",\"\",\"\",\"\",\"\",\"Tìm Kamakura trả lời câu hỏi\",\"\",\"\",\"\",\"\",\"Tìm Kenshinto trả lời câu hỏi\",\"\",\"\",\"\",\"\",\"Gặp Tajima báo cáo\"]', '[]'),
(8, 'NV Tìm hiểu 3 trường', 'Ghi chú: Cô Toyotomi (Trường Hirosaki), Thầy Ookamesama (Trường Ookaza), Thầy Kazeto (Trường Haruna).', '[\"Trình độ đạt cấp 9\",\"Nói chuyện với cô Toyotomi\",\"Nói chuyện với thầy Ookamesama\",\"Nói chuyện với thầy Kazeto\",\"Tìm Tajima báo cáo.\"]', '[]'),
(9, 'NV Gia tăng sức mạnh', 'Ghi chú: Vào hành trang để học sách võ công. Đánh quái để lên cấp, sau khi lên cấp thì tăng điểm kỹ năng rồi tới tăng điểm tiềm năng.', '[\"Học sách võ công\",\"Tăng điểm kỹ năng\",\"Tăng điểm tiềm năng\",\"Xong việc báo lại hiệu trưởng\"]', '[-1, -1, -1, -1]'),
(10, 'NV Bài học đầu tiên', 'Ghi chú: Rùa vàng (Ký túc xá Haruna), nhện đốm (Rừng đào Sakura), quỷ 1 mắt(Hồ Stuki)', '[\"Đánh 50 con rùa vàng\",\"Đánh 30 con nhện đốm\",\"Đánh 20 con quỷ 1 mắt\",\"Báo cáo với hiệu trưởng\"]', '[50,30,20,-1]'),
(11, 'NV Bạn hữu tâm giao', '', '[\"Trình độ đạt cấp 11\",\"Giao lưu bạn hữu\",\"Báo cáo với hiệu trưởng\"]', '[-1,10,-1]'),
(12, 'NV Nâng cấp trang bị', 'Ghi chú: Sau khi nâng cấp trang bị, bạn phải sử dụng nó. Vũ khí: đúng theo lớp đã học, trang sức (dây chuyền hoặc nhẫn hoặc ngọc bội hoặc bùa) y phục (nón hoặc áo hoặc găng tay hoặc quần hoặc giày)', '[\"Trình độ đạt cấp 12\",\"Nâng cấp vũ khí\",\"Nâng cấp trang sức\",\"Nâng cấp y phục\",\"Báo cáo với hiệu trưởng\"]', '[-1, -1, -1, -1, -1]'),
(13, 'NV Thách đấu', 'Ghi chú: Gặp hiệu trưởng của từng trường để thách đấu.', '[\"Trình độ đạt cấp 14\",\"Thách đấu thầy Ookamesama\",\"Thách đấu thầy Kazeto\",\"Thách đấu cô Toyotomi\",\"Báo cáo với Kanata\"]', '[-1, -1, -1, -1, -1]'),
(14, 'NV Thu thập nguyên liệu', 'Ghi chú: Khoáng thạch thường có ở trong Hang Aka, vỏ Ốc đá ở Cánh đồng Hiya.', '[\"Trình độ đạt cấp 16\",\"Tìm khoáng thạch\",\"Nhặt vỏ Ốc Đá\",\"Mang về cho cô Ameji\"]', '[-1,40,60,-1]'),
(15, 'NV Giao thư', '', '[\"Trình độ đạt cấp 19\",\"Giao thư đến Hashimoto\",\"Giao thư đến Fujiwara\",\"Giao thư đến Nao\",\"Báo cáo cô Furoyawa\"]', '[-1, -1, -1, -1, -1]'),
